import React from "react";

export default function Header({ onMenu }) {
  return (
    <header className="header" style={{ display: "flex", alignItems: "center", justifyContent: "space-between" }}>
      <span style={{ fontWeight: 500 }}>Enisi-MS</span>
      <button
        aria-label="Menu"
        style={{
          background: "none",
          border: "none",
          fontSize: 28,
          cursor: "pointer",
          padding: 4,
        }}
        onClick={onMenu}
      >
        &#9776;
      </button>
    </header>
  );
}
